import React from 'react';
import Tilt from 'react-tilt';
 



const Logo = () => {
	return (
		<div className='ma4 mt0'>
			<Tilt className="ba b--yellow-20 Tilt" options={{ max : 25 }} style={{ height: {auto}, width: 100 }} >
			 <div className="Tilt-inner white">
			 		<img src='https://chriskeehk.github.io/QITS/QITS.PNG'/>
			 </div>
			</Tilt>
		</div>
	);
}

export default Logo;
